import styled from 'styled-components';
import React from 'react';
import Add from '../../../../assets/img/adddevice.svg'

const StyledAddIconModal = styled.i`
	position:absolute;
	width: 52px;
  height: 52px;
	top: 17px;
	left: 21px;
	background: url(${(Add)}) center center no-repeat;
`
export default StyledAddIconModal;
